// HomePage.js
import React from 'react';

function HomePage() {
  const [user, setUser] = useState(null);
  return (
    <div>
      <h1>Home</h1>
      {user ? <p>Welcome, {user.email}</p> : <p>Loading...</p>}
    </div>
  );
}

export default HomePage;
